import "../CSS/App.css";
import { Bar } from "react-chartjs-2";

function App() {
    return (
        <div className="App">
            <Bar
                data={{
                    labels: ["a", "b", "c"],
                    datasets: [{ label: "HElloWORLD", data: [1, 2, 3] }],
                }}
                width={100}
                height={100}
            ></Bar>
        </div>
    );
}

export default App;
